{
  "name": "UBX-MGA-INI-TIME-GNSS",
  "class_id": "0x13",
  "message_id": "0x40",
  "description": "Initial time assistance",
  "message_type": "input",
  "payload": {
    "length": {
      "fixed": 24
    },
    "fields": [
      {
        "name": "type",
        "byte_offset": 0,
        "data_type": "U1",
        "description": "Message type (0x11 for this type)"
      },
      {
        "name": "version",
        "byte_offset": 1,
        "data_type": "U1",
        "description": "Message version (0x00 for this version)"
      },
      {
        "name": "ref",
        "byte_offset": 2,
        "data_type": "X1",
        "description": "Reference to be used to set time",
        "bitfield": {
          "bits": [
            {
              "name": "source",
              "bit_start": 0,
              "bit_end": 3,
              "description": "0 = none, i.e. on receipt of message (will be inaccurate!), 1 = relative to pulse sent to EXTINT0, 2 = relative to pulse sent to EXTINT1, 3-15 = reserved"
            },
            {
              "name": "fall",
              "bit_start": 4,
              "bit_end": 4,
              "description": "use falling edge of EXTINT pulse (default rising) - only if source is EXTINT"
            },
            {
              "name": "last",
              "bit_start": 5,
              "bit_end": 5,
              "description": "use last EXTINT pulse (default next pulse) - only if source is EXTINT"
            }
          ]
        }
      },
      {
        "name": "leapSecs",
        "byte_offset": 3,
        "data_type": "I1",
        "description": "Number of leap seconds since 1980 (or 0x80 = -128 if unknown)",
        "unit": "S"
      },
      {
        "name": "year",
        "byte_offset": 4,
        "data_type": "U2",
        "description": "Year"
      },
      {
        "name": "month",
        "byte_offset": 6,
        "data_type": "U1",
        "description": "Month, starting at 1"
      },
      {
        "name": "day",
        "byte_offset": 7,
        "data_type": "U1",
        "description": "Day, starting at 1"
      },
      {
        "name": "hour",
        "byte_offset": 8,
        "data_type": "U1",
        "description": "Hour, from 0 to 23"
      },
      {
        "name": "minute",
        "byte_offset": 9,
        "data_type": "U1",
        "description": "Minute, from 0 to 59"
      },
      {
        "name": "second",
        "byte_offset": 10,
        "data_type": "U1",
        "description": "Seconds, from 0 to 59"
      },
      {
        "name": "bitfield0",
        "byte_offset": 11,
        "data_type": "X1",
        "description": "bitfield:",
        "bitfield": {
          "bits": [
            {
              "name": "trustedSource",
              "bit_start": 0,
              "bit_end": 0,
              "description": "Time is provided from a trusted source. Potentially usable for replay attack detection (0: Unknown, 1: Time source can be trusted for spoofing detection)"
            }
          ]
        }
      },
      {
        "name": "ns",
        "byte_offset": 12,
        "data_type": "U4",
        "description": "Nanoseconds, from 0 to 999,999,999",
        "unit": "ns"
      },
      {
        "name": "tAccS",
        "byte_offset": 16,
        "data_type": "U2",
        "description": "Seconds part of time accuracy",
        "unit": "S"
      },
      {
        "name": "reserved0",
        "byte_offset": 18,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "tAccNs",
        "byte_offset": 20,
        "data_type": "U4",
        "description": "Nanoseconds part of time accuracy, from 0 to 999,999,999",
        "unit": "ns"
      }
    ]
  }
}

